import React from "react";


const DisplayInfo = (name, phone, email) => {
    const { namee } = name;
    const { phonee } = phone;
    const { emaile } = email;

    return (
        <ul>
            <li>{namee}</li>
            <li>{phonee}</li>
            <li>{emaile}</li>
        </ul>
    )
}

export default DisplayInfo;
